import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles((theme) => ({
  button: {
    display: 'block',
    marginTop: theme.spacing(2),
  },
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
  },
}));

export function Cargo(props) {
  const classes = useStyles();
  const [Cargo, setCargo] = React.useState('');
  const [open, setOpen] = React.useState(false);

 /**
  * The handleChange function is used to set the Cargo to the value of the event target
  * @param event - The event that triggered the function.
  */
  const handleChange = (event) => {
    setCargo(event.target.value);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handleOpen = () => {
    setOpen(true);
  };

  return (
    <div>
        <h1>Elige el cargo por el cual deseas ingresar:</h1>
      <Button className={classes.button} onClick={handleOpen}>
        Open the select
      </Button>
      <FormControl className={classes.formControl}>
        <InputLabel id="demo-controlled-open-select-label">Cargo</InputLabel>
        <Select
          labelId="demo-controlled-open-select-label"
          id="demo-controlled-open-select"
          open={open}
          onClose={handleClose}
          onOpen={handleOpen}
          value={Cargo}
          onChange={handleChange}
        >
          <MenuItem value="">
            <em>None</em>
          </MenuItem>
          <MenuItem>Administrativo</MenuItem>
          <MenuItem>Asistente Administrativo</MenuItem>
          <MenuItem>Sistemas</MenuItem>
          <MenuItem>Pastor Local</MenuItem>
